import React from 'react'
// import login_bg from "../Images/login_bg.webp";

export const Register = () => {
    // let style1 = {
    //     height: "78vh",
    //     width: "70vw",
    //     "margin-left": "13vw",
    //     "margin-top": "5vh",
    //     "border": "2px solid blue"
    // }
    // let posi = {
    //     position: "absolute"
    // }
    return (
        <>
            <section className="register">
                <div className='container mt-5'>
                    <div className="reg_content">
                        <div className="form">
                            {/* <img className='center' src={login_bg} alt="background" style={style1} /> */}
                            <h2 className="form-title">Register</h2>
                            <form id="reg-form" className="reg-form">
                                <div className="form-group">
                                    <label htmlFor='name'>
                                        <i class="zmdi zmdi-account material-icons-name"></i>
                                    </label>
                                    <input type="text" name="name" id='name' autoComplete='off' placeholder='Your Name' />
                                </div>

                                <div className="form-group">
                                    <label htmlFor='email'>
                                        <i class="zmdi zmdi-email material-icons-name"></i>
                                    </label>
                                    <input type="email" name="email" id='email' autoComplete='off' placeholder='Your E-mail' />
                                </div>

                                <div className="form-group">
                                    <label htmlFor='Phone'>
                                        <i class="zmdi zmdi-phone-in-talk material-icons-name"></i>
                                    </label>
                                    <input type="number" name="Phone" id='Phone' autoComplete='off' placeholder='Your phone' />
                                </div>
                                <div className="form-group">
                                    <label htmlFor='name'>
                                        <i class="zmdi zmdi-account material-icons-name"></i>
                                    </label>
                                    <input type="text" name="name" id='name' autoComplete='off' placeholder='Your Name' />
                                </div>
                                <div className="form-group">
                                    <label htmlFor='name'>
                                        <i class="zmdi zmdi-account material-icons-name"></i>
                                    </label>
                                    <input type="text" name="name" id='name' autoComplete='off' placeholder='Your Name' />
                                </div>
                                <div className="form-group">
                                    <label htmlFor='name'>
                                        <i class="zmdi zmdi-account material-icons-name"></i>
                                    </label>
                                    <input type="text" name="name" id='name' autoComplete='off' placeholder='Your Name' />
                                </div>
                            </form>
                        </div>

                    </div>

                </div>
            </section>

        </>
    )
}
